import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Login from "./Login";
import Registration from "./Registration";
import Main from "./Main";

function App() {
  const router = createBrowserRouter([

    {
      path: "/",
      element: <Login />
    },
    {
      path: "/Register",
      element: <Registration/>
    },
    {
      path: "/Main",
      element: <Main/>
    },
    {
      path: "/Main",
      element: <Main/>
    },
  ])
  return (
    <>
      <RouterProvider router={router} />
    </>
    )
}

export default App;
